	def savePollResult(self,buttonID,selected):

		if (self.getPageToken()!=self.__class__.bridgesPollSession):
			return "Выполните опрос видеобриджа перед применением данных"

		pollResult=self.__class__.bridgesPollResult
		if self.buttons[buttonID]["name"]=="Применить все":
			controlBlocks=ControlBlocks.objects.all()
		else:
			if selected!=0:
				#taskArray with 1 item
				bridges=Bridges.objects.filter(id__exact=int(selected))
				if bridges.count()!=1:
					return "Выбран некорректный видеобридж"	
				controlBlocks=ControlBlocks.objects.filter(bridges__id__exact=selected)
			else:
				return "Выберите видеобридж для применения данных опроса"

		opt=self.loadOptions()
		taskArray=[]
		for cb in controlBlocks:
			someBridgesSkipped=False
			cbBridges=cb.bridges_set.all()
			thisCbData=[]
			thisCbTasks=[]
			progress=SharedString()
			error=SharedString()
			for bridge in cbBridges:
				if bridge.id not in pollResult.keys():
					someBridgesSkipped=True
					break
				else:
					thisCbTasks+=[{
						"id":bridge.id,
						"progress":progress,
						"error":error,
						"fake":True}]

					thisBridgeData=[{
						"chName":channel["name"],
						"chIp":channel["ip"],
						"chPort":channel["port"],
						"chIndex":channel["index"],
						"vbName":bridge.name,
						"vbIp":bridge.ip}
						for channel in pollResult[bridge.id]]

					# thisCbData+=sorted(thisBridgeData,key=lambda item: int(item["index"]))
					thisCbData+=thisBridgeData
			#endfor bridge

			#if some bridges in cb are skipped - then skip whole cb
			if someBridgesSkipped:
				thisCbTasks=[{
						"id":bridge.id,
						"progress":10,
						"error":"Видеобридж не опрошен",
						"fake":True} for bridge in cbBridges]
				taskArray+=thisCbTasks
			else:
				#one task in cb is not fake and really make a job
				#another tasks are fake and used for displaying a progress
				for task in thisCbTasks:
					task["cbName"]=cb.name
					task["cbIp"]=cb.ip
					task["data"]=thisCbData
					task["cb"]=cb
					task["fake"]=False
					break
				taskArray+=thisCbTasks
		#endfor cb
		
		#save controlblock taskfiles in multithreading mode
		self.startJob(taskArray,controller.saveCBFile,opt=opt)

		#save ok sb to database for comparing next time
		cbNoErrors=[task["cb"] for task in taskArray if task["fake"]==False and str(task["error"])==""]
		bridgeNoErrors=Bridges.objects.filter(controlblock__in=cbNoErrors)

		for bridge in bridgeNoErrors:
			bridge.channels_set.all().delete()
			Channels.objects.bulk_create([
				Channels(
					name=ch["name"], ip=ch["ip"], port=ch["port"], index=ch["index"],
					bridge=bridge)
				for ch in pollResult[bridge.id]
				])
			chCount=self.__class__.bridgesChannelCount.get(bridge.id,'0')
			bridge.chcount=chCount
			bridge.save()

		#alert message to user
		totalCount=len(controlBlocks)
		okCount=len(cbNoErrors)
		if okCount==0:
			return "Ошибка применения файла задания"
		elif totalCount==0:
			return
		elif okCount==totalCount:
			return "Файл задания успешно применен"
		else:
			itemsToShow=12
			cbWithErrors=[cb.name for cb in controlBlocks if cb not in cbNoErrors]
			errorCount=len(cbWithErrors)
			cbWithErrors.sort()
			cbWithErrors=cbWithErrors[0:itemsToShow]
			s="Новый файл задания частично применен\n" +\
				"Некоторые блоки контроля применить не удалось:\n"+\
				"\n".join(cbWithErrors)
			if errorCount>len(cbWithErrors):
				s+="\n...\n({0} элементов не показано)".format(errorCount-len(cbWithErrors))
			return s
	#end sub


